+func getTensorFromGraph(t *testing.T, graphStr string) *tf.Tensor {
+	graph, err := tf.NewGraphFromText(graphStr)
+	if err != nil {
+		t.Fatal(err)
+	}
+	s, err := tf.NewSession()
+	if err := s.ExtendGraph(graph); err != nil {
+		t.Fatal(err)
+	}
+
+	output, err := s.Run(nil, []string{"output"}, nil)
+	if err != nil {
+		t.Fatal(err)
+	}
+
+	if len(output) != 1 {
+		t.Fatalf("The expexted number of tensors is 1 but there was %d tensors returned", len(output))
+		t.FailNow()
+	}
+
+	return output[0]
+}
